from bs4 import BeautifulSoup
import urllib.request
from  selenium import webdriver
import time
import json

def get_org_links():
    urls = ["https://www.ulife.utoronto.ca/organizations/list/type/all/alpha/a-c",
            "https://www.ulife.utoronto.ca/organizations/list/type/all/alpha/d-j",
            "https://www.ulife.utoronto.ca/organizations/list/type/all/alpha/k-o",
            "https://www.ulife.utoronto.ca/organizations/list/type/all/alpha/p-t",
            "https://www.ulife.utoronto.ca/organizations/list/type/all/alpha/u-z"]
    
    links_to_search = []

    for url in urls:
        driver = webdriver.PhantomJS('/mnt/c/Users/Vaskar/Downloads/phantomjs-2.1.1-windows/phantomjs-2.1.1-windows/bin/phantomjs.exe')
        driver.get(url)
        parser = 'html.parser'  
        curr_page = driver.current_url
        next_page = ""
        i = 1
        while curr_page != next_page:
            curr_page = driver.current_url
            data = driver.page_source
            soup = BeautifulSoup(data, parser)
            next_page_button = driver.find_element_by_class_name("paginateNext")
            for link in soup.find_all('a', href=True):
                if "/organizations/view/id" in link['href']:
                    links_to_search.append(link['href'])
            next_page_button.click()
            next_page = driver.current_url
            print(i)
            i += 1
    driver.close()
    return links_to_search

def get_org_info(links):
    result = {}
    i = 1
    driver = webdriver.PhantomJS('/mnt/c/Users/Vaskar/Downloads/phantomjs-2.1.1-windows/phantomjs-2.1.1-windows/bin/phantomjs.exe')
    for link in links:
        print("On Site ", i)
        url = "https://www.ulife.utoronto.ca/" + link
        driver.get(url)
        parser = 'html.parser' 
        data = driver.page_source
        soup = BeautifulSoup(data, parser)

        club_name = soup.find_all("h1", {"class" : "detailHeading"})[0].get_text()
        desc = soup.find_all("div", {"class": ""})[4].get_text()
        result[club_name] = desc.strip("\n")
        i += 1
    with open('../data/org_data_uoft.json', 'w') as fp:
        json.dump(result, fp)

        
